    return (
        <nav>
            <img className="headshot" src={headShot} alt="headshot"/>
            <h1 className="first-last-name">Luigi Mota</h1>
            <h3 className="job-title">Frontend Developer</h3>
            <h4 className="web-site">luigimota.com</h4>


        </nav>

    )
};
